const authreducer = (state = false,action) => {
    switch(action.type){
        case 'AUTH_USER':
            return state
        case 'LOGGED_IN':
            return !state
        case 'LOGGED_OUT':
            return !state
        default:
            return state
    }
}

export default authreducer
